public class Solution {
    public int[] FindIntersectionValues(int[] nums1, int[] nums2) {
        // Convert both arrays to hash sets for efficient lookup
        HashSet<int> setNums1 = new HashSet<int>(nums1);
        HashSet<int> setNums2 = new HashSet<int>(nums2);

        // Calculate the intersection of setNums1 and setNums2
        setNums1.IntersectWith(setNums2);

        // Initialize counters
        int countInNums1 = 0;
        int countInNums2 = 0;

        // Count how many elements in nums1 are in the intersection
        foreach (int num in nums1) {
            if (setNums1.Contains(num)) {
                countInNums1++;
                // Remove the number to avoid counting duplicates in nums1
                setNums1.Remove(num);
            }
        }

        // Reset setNums1 for reuse
        setNums1 = new HashSet<int>(nums1);

        // Count how many elements in nums2 are in the intersection
        foreach (int num in nums2) {
            if (setNums1.Contains(num)) {
                countInNums2++;
                // Remove the number to avoid counting duplicates in nums2
                setNums1.Remove(num);
            }
        }

        // Return the result as an array
        return new int[] { countInNums1, countInNums2 };
    }
}
